import React from 'react'
import Button from '@material-ui/core'
import FacebookIcon from '@material-ui/icons/Facebook';

export default class ButtnfromReg extends React.Component{
    render(){
        return(
            <div>
                <Button ><FacebookIcon></FacebookIcon>Login with Facebook</Button>
                <Button><span style={{marginRight:"30px",fontSize:"20px"}}>G</span>Login with Google</Button>
            </div>
        )
    }
}
